import React from 'react';
// import './ForgetPassword.css';

function user(){
    var userName=document.getElementById('username');
    var pw=document.getElementById('password');
    return;
}

function ForgetPassword(){
    return (
        <>
            <header>
                <h1> MPT Fitness App</h1>
            </header>
            <div class="container-forgetpw">
                    <div class="password-forgetpw">
                        <label for="password-forgetpw">New Password: </label>
                        <input tabindex="1" type="password" id="password-forgetpw"/>
                    </div>
                    <div class="empty-forgetpw">
                        <label id="empty-forgetpw">&nbsp</label>
                        <p>At least 8 to 20 characters</p>
                    </div>
                    <div class="confirm_password-forgetpw">
                        <label for="confirm_password-forgetpw">Confirm Password:</label>
                        <input tabindex="2" type="password" id="confirm_password-forgetpw"/>
                    </div>
                    <div class="empty-forgetpw">
                        <label id="empty-forgetpw">&nbsp</label>
                        <p>At least 8 to 20 characters</p>
                    </div>
            </div>
            <div class="button-forgetpw">
                <input tabindex="3" type="button" id="login-forgetpw" onclick="document.location='../login.html'" value="Update"/>
            </div>
        </>
    );
}

export default ForgetPassword;
